const user = {
  firstName: "John",
  lastName: "Doe",
  postalCode: "1234"
};
cy.wrap(username).each(username => {
  cy.loginToApp(username, "secret_sauce");
  _homePage.onHomePage.addToCart(3).then(({
    _itemsName,
    _itemsPrice
  }) => {
    cy.get(".shopping_cart_link").click();
    _cartPage.onCartPage.checkProductList(_itemsName, _itemsPrice);
    cy.contains("Checkout").click();
    _checkoutPage.onCheckoutPage.submitForm(user);
    _checkoutPage.onCheckoutPage.checkProductOverview(_itemsName, _itemsPrice);
    cy.contains("Finish").click();
    cy.contains("Thank you for your order!");
  });
  cy.then(Cypress.session.clearCurrentSessionData);
});

